{
    "company_id": 1,
    "company_name": "Tesla",
    "company_address": "Nicholastown, IL 80126",
    "company_status": "ACTIVE",
    "description_lang": [
        {
            "translation_lang": "EN",
            "translation": "Once upon a time, in the depths of the vast ocean, there lived a curious little fish named Finn. Finn had shimmering scales that sparkled like diamonds under the sunlight. He swam tirelessly through the coral reefs, exploring every nook and cranny of his underwater world."
        },
        {
            "translation_lang": "RU",
            "translation": "Однажды, в глубинах огромного океана, жила любознательная маленькая рыбка по имени Финн. У Финна были сверкающие чешуи, которые блестели как алмазы под солнечными лучами. Он неустанно плавал по коралловым рифам, исследуя каждую щель и уголок своего подводного мира."
        },
        {
            "translation_lang": "PL",
            "translation": "Pewnego razu, w głębinach ogromnego oceanu, mieszkała ciekawa mała rybka o imieniu Finn. Finn miał błyszczące łuski, które migotały jak diamenty pod światłem słonecznym. Niezmordowanie przemierzał rafy koralowe, eksplorując każdą szczelinę i zakamarek swojego podwodnego świata."
        },
        {
            "translation_lang": "UA",
            "translation": "Одного разу, у глибинах великого океану, жила цікава маленька рибка на ім'я Фінн. У Фінна були блискучі луски, які сяяли як діаманти під сонячними променями. Він неутомно плавав по коралових рифах, досліджуючи кожну щілину та куток свого підводного світу."
        }
    ]
}

